import React,{ Component } from 'react';
import Cardlist from './cardlist.js';
import SearchBox from './Searchbox.js';
import {robots} from './robots.js';


class App extends Component{
	constructor(){
		super()
		this.state={
			robot:robots,
			Searchfield:'',
		}
	}

	render(){	
		return(
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox/>
				<Cardlist robots={ robots }/>
			</div>
			);
	}
}

export default App;
